import * as React from "react";

interface IconProps {
  width?: number;
  height?: number;
  fill?: string;
  className?: string;
}

const PhoneIcon: React.FC<IconProps> = (props) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    width={props.width}
    height={props.height}
    {...props}
  >
    <defs>
      <image
        id="phoneIcon"
        width={props.width}
        height={props.height}
        href="data:image/png;base64,"
      />
    </defs>
    <use href="#phoneIcon" />
  </svg>
);
export default PhoneIcon;
